function App() {
  const araay=[
   {
   name:"max",
   img:"http://www.imgworlds.com/wp-content/uploads/2015/12/18-CONTACTUS-HEADER.jpg",
   twater:" Hi my name max"
  },
  {
    name:"max2",
    img:"http://www.imgworlds.com/wp-content/uploads/2015/12/18-CONTACTUS-HEADER.jpg",
    twater:" Hi my name max"
   },
   {
    name:"max3",
    img:"http://www.imgworlds.com/wp-content/uploads/2015/12/18-CONTACTUS-HEADER.jpg",
    twater:" Hi my name max"
   }
  ]
  return (
    <div className="App">
      {araay.map(function(d, idx){
         return (
         <li key={idx}>{d.name}+ {d.img}+{}</li>

         )
       })}

    </div>
  );
}

export default App;
